(14814, 'wpmembers_dialogs', 'a:9:{s:14:\"restricted_msg\";s:39:\"회원가입 후 사용가능합니다.\";s:4:\"user\";s:47:\"해당 아이디가 이미 사용 중입니다.\";s:5:\"email\";s:57:\"해당 이메일은 이미 등록 되어 있습니니다.\";s:7:\"success\";s:143:\"축하합니다! 회원가입이 완료되었습니다. <br /><br /> 이메일을 확인해서 로그인해 주시기 바랍니다.<br /><br />\";s:11:\"editsuccess\";s:82:\"정보가 업데이트 되었습니다.<br /><br />\r\nYour information was updated!\";s:11:\"pwdchangerr\";s:108:\"비밀번호가 일치하지 않습니다. <br /><br />Passwords did not match.<br /><br />Please try again.\";s:16:\"pwdchangesuccess\";s:81:\"비빌번호가 변경되었습니다. <br /><br />Password successfully changed!\";s:11:\"pwdreseterr\";s:55:\"아이디 또는 이메일이 존재하지 않습니다\";s:15:\"pwdresetsuccess\";s:117:\"비빌번호가 변경되었습니다!<br /><br /> 새 비밀번호가 포함 된 이메일이 발송되었습니다.\";}', 'yes'),
(14815, 'wpmembers_email_newreg', 'a:2:{s:4:\"subj\";s:57:\"[blogname] 새 회원가입 정보를 알려드립니다.\";s:4:\"body\";s:322:\"[blogname] 회원가입을 축하합니다. \r\n\r\n회원등록 정보입니다.\r\n아래의 비밀번호를 보관해 주시기 바랍니다.\r\n\r\n사용자명: [username]\r\n비빌번호: [password]\r\n\r\n아래 링크로 로그인할 수 있습니다:\r\n[reglink]\r\n\r\n패스워드를 변경하실 수 있습니다:\r\n[user-profile]\r\n\";}', 'no'),
(14816, 'wpmembers_email_newmod', 'a:2:{s:4:\"subj\";s:40:\"Thank you for registering for [blogname]\";s:4:\"body\";s:173:\"Thank you for registering for [blogname]. \r\nYour registration has been received and is pending approval.\r\nYou will receive login instructions upon approval of your account\r\n\";}', 'no'),
(14817, 'wpmembers_email_appmod', 'a:2:{s:4:\"subj\";s:50:\"Your registration for [blogname] has been approved\";s:4:\"body\";s:300:\"Your registration for [blogname] has been approved.\r\n\r\nYour registration information is below.\r\nYou may wish to retain a copy for your records.\r\n\r\nusername: [username]\r\npassword: [password]\r\n\r\nYou may log in and change your password here:\r\n[user-profile]\r\n\r\nYou originally registered at:\r\n[reglink]\r\n\";}', 'no'),
(14818, 'wpmembers_email_repass', 'a:2:{s:4:\"subj\";s:53:\"[blogname] 비빌번호가 초기화 되었습니다.\";s:4:\"body\";s:181:\"[blogname] 비빌번호가 초기화 되었습니다.\r\n\r\n새 암호가 아래에 포함되어 있습니다. 기록 사본을 보관할 수도 있습니다.\r\n\r\npassword: [password]\r\n\";}', 'no'),
(14819, 'wpmembers_email_notify', 'a:2:{s:4:\"subj\";s:36:\"New user registration for [blogname]\";s:4:\"body\";s:194:\"The following user registered for [blogname]:\r\n\r\nusername: [username]\r\nemail: [email]\r\n\r\n[fields]\r\nThis user registered here:\r\n[reglink]\r\n\r\nuser IP: [user-ip]\r\n\r\nactivate user: [activate-user]\r\n\";}', 'no'),
