\"유로카닷넷 (http://uloca.net ) - 경쟁기업의 입찰과 낙찰이력을 빠르게 검색합니다. 경쟁사의 입찰과 낙찰이력을 볼 수 있으니, 활용해 보시기 바랍니다. 1) 입찰정보 - 나라장터(조달청) 모든 입찰정보를 검색합니다. 발주계획, 사전규격, 입찰공고를 공사, 물품, 용역 모두 검색합니다. 2) 입찰기업 경쟁사의 입찰이력 검색 - 기업명 또는 대표자명을 입력하면 해당 기업의 입찰이력을 검색합니다. 3) 모바일 전용 검색 서비스를 지원 - 모바일에서 간편하게 검색할 수 있도록 디자인 되어있습니다.\";s:12:\"noindex-post\";b:0;s:13:\"showdate-post\";b:0;s:23:\"display-metabox-pt-post\";b:1;s:23:\"post_types-post-maintax\";i:0;s:10:\"title-page\";s:39:\"%%title%% %%page%% %%sep%% %%sitename%%\";s:13:\"metadesc-page\";s:0:\"\";s:12:\"noindex-page\";b:0;s:13:\"showdate-page\";b:0;s:23:\"display-metabox-pt-page\";b:1;s:23:\"post_types-page-maintax\";i:0;s:16:\"title-attachment\";s:39:\"%%title%% %%page%% %%sep%% %%sitename%%\";s:19:\"metadesc-attachment\";s:0:\"\";s:18:\"noindex-attachment\";b:0;s:19:\"showdate-attachment\";b:0;s:29:\"display-metabox-pt-attachment\";b:1;s:29:\"post_types-attachment-maintax\";i:0;s:12:\"title-kboard\";s:39:\"%%title%% %%page%% %%sep%% %%sitename%%\";s:15:\"metadesc-kboard\";s:0:\"\";s:14:\"noindex-kboard\";b:0;s:15:\"showdate-kboard\";b:0;s:25:\"display-metabox-pt-kboard\";b:1;s:25:\"post_types-kboard-maintax\";i:0;s:18:\"title-tax-category\";s:53:\"%%term_title%% Archives %%page%% %%sep%% %%sitename%%\";s:21:\"metadesc-tax-category\";s:171:\"나라장터 입찰정보 낙찰정보 낙찰기업 낙찰결과 조달청 일찹공고 발주계획 입찰공고 사전공고 사전규격 기업검색 기업낙찰현황\";s:28:\"display-metabox-tax-category\";b:1;s:20:\"noindex-tax-category\";b:0;s:18:\"title-tax-post_tag\";s:53:\"%%term_title%% Archives %%page%% %%sep%% %%sitename%%\";s:21:\"metadesc-tax-post_tag\";s:171:\"나라장터 입찰정보 낙찰정보 낙찰기업 낙찰결과 조달청 일찹공고 발주계획 입찰공고 사전공고 사전규격 기업검색 기업낙찰현황\";s:28:\"display-metabox-tax-post_tag\";b:1;s:20:\"noindex-tax-post_tag\";b:0;s:21:\"title-tax-post_format\";s:53:\"%%term_title%% Archives %%page%% %%sep%% %%sitename%%\";s:24:\"metadesc-tax-post_format\";s:171:\"나라장터 입찰정보 낙찰정보 낙찰기업 낙찰결과 조달청 일찹공고 발주계획 입찰공고 사전공고 사전규격 기업검색 기업낙찰현황\";s:31:\"display-metabox-tax-post_format\";b:0;s:23:\"noindex-tax-post_format\";b:1;}', 'yes'),
