(35472, 'cosmosfarm_members_policy_service', '\\\"모노리스\\\"에서는 회원제도를 시행하고 있으니 이점 유의 하여 주시기 바랍니다.\r\n\r\n유로카닷넷(uloca.net)의 데이터는 국가 공공데이터포털 (http://data.go.kr) 에서 제공하는 API 데이터를 기반으로 합니다. 하지만, 유로카닷넷에서 제공하는 입찰이력, 낙찰결과, 통계 및 차트(chart)그래프 등 모든 데이터 서비스는 가공 시 누락이 있을 수 있으니 참조( 參照) 용도로만 사용하는 것으로,  데이터 정합성 및 품질과 관련한 어떠한 법적인 문제도 책임 지지 않습니다.\r\n<h4>#### 모노리스(www.uloca.net) 서비스 약관 #######################</h4>\r\n제1조 (목적)\r\n\r\n① 모노리스 (www.uloca.net) 서비스 약관(이하 \\\"본 약관\\\"이라 합니다)은 이용자가 모노리스(이하 \\\"모노리스\\\"라 합니다)에서 제공하는 인터넷 관련 모든 서비스(이하 \\\"서비스\\\"라 합니다)를 이용함에 있어 이용자와 \\\"모노리스\\\"의 권리·의무 및 책임사항을 규정함을 목적으로 합니다.\r\n\r\n② 이용자가 되고자 하는 자가 \\\"모노리스\\\"가 정한 소정의 절차를 거쳐서 \\\"가입하기\\\" 단추를 누르면 본 약관에 동의하는 것으로 간주합니다. 본 약관에 정하는 이외의 이용자와 \\\"모노리스\\\"의 권리, 의무 및 책임사항에 관해서는 전기통신사업법 기타 대한민국의 관련 법령과 상관습에 의합니다.\r\n\r\n제2조 (정의)\r\n\r\n① \\\"모노리스\\\"이란 자유로운 상품 또는 용역(이하 “상품”이라 함)의 거래를 위하여 \\\"모노리스\\\"가 제공하는 실시간 전자상거래 시스템 및 그 운영을 위한 웹사이트 혹은 가상의 영업장을 말합니다.\r\n\r\n② \\\"이용자\\\"란 \\\"서비스\\\"에 접속하여 이 약관에 따라 \\\"모노리스\\\"가 제공하는 서비스를 받는 회원 및 비회원을 말합니다.\r\n\r\n③ \\\"회원\\\"이라 함은 \\\"서비스\\\"에 개인정보를 제공하여 회원등록을 한 자로서, \\\"모노리스\\\"의 정보를 지속적으로 제공받으며, \\\"모노리스\\\"가 제공하는 서비스를 계속적으로 이용할 수 있는 자를 말합니다.\r\n\r\n④ \\\"비회원\\\"이라 함은 회원에 가입하지 않고 \\\"모노리스\\\"가 제공하는 서비스를 이용하는 자를 말합니다.\r\n\r\n⑤ 기타 언급되지 않은 사항은 일반 통상적 회원가입 기준을 따릅니다.\r\n\r\n제3조 (약관 등의 명시와 설명 및 개정)\r\n\r\n① \\\"모노리스\\\"는 이 약관의 내용과 상호 및 대표자 성명, 영업소 소재지 주소(소비자의 불만을 처리할 수 있는 곳의 주소를 포함), 전화번호·모사전송번호·전자우편주소, 사업자등록번호, 통신판매업신고번호, 개인정보 관리 책임자 등을 이용자가 쉽게 알 수 있도록 초기 서비스화면(전면)에 게시합니다. 다만, 약관의 내용은 이용자가 연결화면을 통하여 볼 수 있도록 할 수 있습니다.\r\n\r\n② \\\"모노리스\\\"는 이용자가 약관에 동의하기에 앞서 약관에 정하여져 있는 내용 중 청약철회·배송책임·환불조건 등과 같은 중요한 내용을 이용자가 이해할 수 있도록 별도의 연결화면 또는 팝업화면 등을 제공하여 이용자의 확인을 구하여야 합니다.\r\n\r\n③ \\\"모노리스\\\"는 전자상거래 등에서의 소비자보호에 관한 법률, 약관의 규제에 관한 법률, 전자거래기본법, 전자서명법, 정보통신망이용촉진 등에 관한 법률, 방문판매 등에 관한 법률, 소비자보호법 등 관련법을 위배하지 않는 범위에서 이 약관을 개정할 수 있습니다.\r\n\r\n④ \\\"모노리스\\\"는 약관을 개정할 경우에는 적용일자 및 개정사유를 명시하여 현행약관과 함께 초기화면에 그 적용일자 7일 이전부터 적용일자 전일까지 공지합니다. 다만, 이용자에게 불리하게 약관내용을 변경하는 경우에는 최소한 30일 이상의 사전 유예기간을 두고 공지합니다. 이 경우 \\\"모노리스\\\"는 개정 전 내용과 개정 후 내용을 명확하게 비교하여 이용자가 알기 쉽도록 표시합니다.\r\n\r\n⑤ \\\"모노리스\\\"가 약관을 개정할 경우에는 \\\"모노리스\\\" 내 고지 또는 전자우편 등 1가지 이상의 방법을 통해 고지하며 개정 이전에 가입한 기존회원은 개정 이후 7일 이내에 별도 이의를 표시하지 아니한 경우에는 개정 이후의 약관 조항이 그대로 적용되는 것으로 봅니다.\r\n\r\n⑥ 이 약관에서 정하지 아니한 사항과 이 약관의 해석에 관하여는 전자상거래 등에서의 소비자보호에 관한 법률, 약관의 규제 등에 관한 법률, 공정거래위원회가 정하는 전자상거래 등 에서의 소비자보호지침 및 관계법령 또는 상관례에 따릅니다. 제\r\n\r\n4조 (서비스의 제공 및 변경)\r\n\r\n① \\\"모노리스\\\"는 다음과 같이 서비스를 제공합니다.\r\n\r\n1. 재화 또는 용역에 대한 정보 제공 및 구매계약의 체결\r\n\r\n2. 구매계약이 체결된 재화 또는 용역의 배송\r\n\r\n3. E-Commerce Platform 개발 및 운영서비스\r\n\r\n4. 광고 및 프로모션 서비스\r\n\r\n5. 칼럼 서비스\r\n\r\n6. 회원을 위한 섹션 및 컨텐트 서비스, 맞춤 서비스\r\n\r\n7. 메시지 전송, 메일 통보, 친구찾기, 1:1 채팅, 실시간 뉴스, 입찰정보 제공 등을 내용으로 하는 메신저 서비스\r\n\r\n8. 이메일 서비스와 동호회 및 까페 이용서비스\r\n\r\n9. 기타 \\\"모노리스\\\"가 자체 개발하거나 다른 회사와의 협력계약 등을 통해 회원들에게 제공할 일체의 서비스\r\n\r\n② \\\"모노리스\\\"는 재화 또는 용역의 품절 또는 기술적 사양의 변경 등의 경우에는 장차 체결되는 계약에 의해 제공할 재화 또는 용역의 내용을 변경할 수 있습니다. 이 경우에는 변경된 재화 또는 용역의 내용 및 제공일자를 명시하여 현재의 재화 또는 용역의 내용을 게시한 곳에 즉시 공지합니다.\r\n\r\n③ \\\"모노리스\\\"가 제공하기로 이용자와 계약을 체결한 서비스의 내용을 재화등의 품절 또는 기술적 사양의 변경 등의 사유로 변경할 경우에는 그 사유를 이용자에게 통지 가능한 주소로 즉시 통지합니다.\r\n\r\n④ 전항의 경우 \\\"모노리스\\\"는 이로 인하여 이용자가 입은 손해를 배상합니다. 다만, \\\"모노리스\\\"가 고의 또는 과실이 없음을 입증하는 경우에는 그러하지 아니합니다.\r\n\r\n⑤ 유로카닷넷(uloca.net)의 데이터는 국가 공공데이터포털 (http://data.go.kr) 에서 제공하는 API 데이터를 기반으로 합니다. 하지만, 유로카닷넷에서 제공하는 입찰이력, 낙찰결과, 통계 및 차트(chart)그래프 등 모든 데이터 서비스는 가공 시 누락이 있을 수 있으니 참조( 參照) 용도로만 사용하는 것으로,  데이터 정합성 및 품질과 관련한 어떠한 법적인 문제도 책임 지지 않습니다.\r\n\r\n&nbsp;\r\n\r\n제5조 (서비스의 중단)\r\n\r\n① \\\"모노리스\\\"는 컴퓨터 등 정보통신설비의 보수점검·교체 및 고장, 통신의 두절 등의 사유가 발생한 경우에는 서비스의 제공을 일시적으로 중단할 수 있습니다.\r\n\r\n② \\\"모노리스\\\"는 제1항의 사유로 서비스의 제공이 일시적으로 중단됨으로 인하여 이용자 또는 제3자가 입은 손해에 대하여 배상합니다. 다만, \\\"모노리스\\\"가 통제할 수 없는 사유로 인한 서비스의 중단(시스템 관리자의 고의, 과실이 없는 디스크 장애, 시스템 다운 등)으로 인하여 사전 통지가 불가능한 경우에는 그러하지 아니합니다.\r\n\r\n③ 사업종목의 전환, 사업의 포기, 업체간의 통합 등의 이유로 서비스를 제공할 수 없게 되는 경우에는 \\\"모노리스\\\"는 제8조에 정한 방법으로 이용자에게 통지하고 당초 \\\"모노리스\\\"에서 제시한 조건에 따라 소비자에게 보상합니다. 다만, \\\"모노리스\\\"가 보상기준 등을 고지하지 아니한 경우에는 이용자들의 마일리지 및 적립금 등을 \\\"모노리스\\\"에서 통용되는 통화가치에 상응하는 현물 또는 현금으로 이용자에게 지급합니다.\r\n\r\n제6조 (회원가입)\r\n\r\n① 이용자는 \\\"모노리스\\\"가 정한 가입 양식에 따라 회원정보를 기입한 후 이 약관에 동의한다는 의사표시를 함으로서 회원가입을 신청합니다.\r\n\r\n② \\\"모노리스\\\"는 제1항과 같이 회원으로 가입할 것을 신청한 이용자 중 다음 각호에 해당하지 않는 한 회원으로 등록합니다.\r\n\r\n1. 가입신청자가 이 약관 제7조제3항에 의하여 이전에 회원자격을 상실한 적이 있는 경우, 다만 제7조제3항에 의한 회원자격 상실후 3년이 경과한 자로서 \\\"모노리스\\\"의 회원재가입 승낙을 얻은 경우에는 예외로 한다.\r\n\r\n2. 등록 내용에 허위, 기재누락, 오기가 있는 경우\r\n\r\n3. 기타 회원으로 등록하는 것이 \\\"모노리스\\\"의 기술상 현저히 지장이 있다고 판단되는 경우\r\n\r\n③ 회원가입계약의 성립시기는 \\\"모노리스\\\"의 승낙이 회원에게 도달한 시점으로 합니다.\r\n\r\n④ 회원은 제17조 제1항에 의한 등록사항에 변경이 있는 경우, 즉시 전자우편 및 기타 방법으로 \\\"모노리스\\\"에 대하여 그 변경사항을 알려야 합니다.\r\n\r\n제7조(회원 탈퇴 및 자격 상실 등)\r\n\r\n① 회원은 \\\"모노리스\\\"에 언제든지 탈퇴를 요청할 수 있으며 \\\"모노리스\\\"는 즉시 회원탈퇴를 처리합니다. 회원탈퇴 시, 회원의 모든 정보 및 여타 적립금은 삭제되며, 복구되지 않습니다.\r\n\r\n② 회원이 다음 각호의 사유에 해당하는 경우, \\\"모노리스\\\"는 회원자격을 제한 및 정지시킬 수 있습니다.\r\n\r\n1. 가입 신청 시에 허위 내용을 등록한 경우\r\n\r\n2. \\\"모노리스\\\"을 이용하여 구입한 재화 등의 대금, 기타 \\\"모노리스\\\" 이용에 관련하여 회원이 부담하는 채무를 기일에 지급 하지 않는 경우\r\n\r\n3. 다른 사람의 \\\"서비스\\\" 이용을 방해하거나 그 정보를 도용하는 등 전자상거래 질서를 위협하는 경우\r\n\r\n4. \\\"모노리스\\\"을 이용하여 법령 또는 이 약관이 금지하거나 공서양속에 반하는 행위를 하는 경우\r\n\r\n③ \\\"모노리스\\\"가 회원 자격을 제한·정지 시킨 후, 동일한 행위가 2회 이상 반복되거나 30일 이내에 그 사유가 시정되지 아니하는 경우 \\\"모노리스\\\"는 회원자격을 상실시킬 수 있습니다.\r\n\r\n④ \\\"모노리스\\\"가 회원자격을 상실시키는 경우에는 회원등록을 말소합니다. 이 경우 회원에게 이를 통지하고, 회원등록 말소 전 최소한 30일 이상의 기간을 정하여 소명할 기회를 부여합니다.\r\n\r\n제8조(회원에 대한 통지)\r\n\r\n① \\\"모노리스\\\"가 회원에 대한 통지를 하는 경우, 회원이 \\\"모노리스\\\"와 미리 약정하여 지정한 전자우편 주소로 할 수 있습니다.\r\n\r\n② \\\"모노리스\\\"는 불특정다수 회원에 대한 통지의 경우 1주일이상 \\\"모노리스\\\" 게시판에 게시함으로써 개별 통지에 갈음할 수 있습니다. 다만, 회원 본인의 거래와 관련하여 중대한 영향을 미치는 사항에 대하여는 개별통지를 합니다.\r\n\r\n제9조(구매신청)\r\n\r\n\\\"서비스\\\" 이용자는 \\\"모노리스\\\" 상에서 다음 또는 이와 유사한 방법에 의하여 구매를 신청하며, \\\"모노리스\\\"는 이용자가 구매신청을 함에 있어서 다음의 각 내용을 알기 쉽게 제공하여야 합니다. 단, 회원인 경우 제2호 내지 제4호의 적용을 제외할 수 있습니다.\r\n\r\n1. 재화 등의 검색 및 선택\r\n\r\n2. 성명, 주소, 전화번호, 전자우편주소(또는 이동전화번호) 등의 입력\r\n\r\n3. 약관내용, 청약철회권이 제한되는 서비스, 배송료·설치비 등의 비용부담과 관련한 내용에 대한 확인\r\n\r\n4. 이 약관에 동의하고 위 3.호의 사항을 확인하거나 거부하는 표시(예, 마우스 클릭)\r\n\r\n5. 재화 등의 구매신청 및 이에 관한 확인 또는 \\\"모노리스\\\"의 확인에 대한 동의 6. 결제방법의 선택\r\n\r\n제10조 (구매계약의 성립)\r\n\r\n① \\\"모노리스\\\"는 제9조와 같은 구매신청에 대하여 다음 각호에 해당하면 승낙하지 않을 수 있습니다. 다만, 미성년자와 계약을 체결하는 경우에는 법정대리인의 동의를 얻지 못하면 미성년자 본인 또는 법정대리인이 계약을 취소할 수 있다는 내용을 고지하여야 합니다.\r\n\r\n1. 신청 내용에 허위, 기재누락, 오기가 있는 경우\r\n\r\n2. 미성년자가 담배, 주류 등 청소년보호법에서 금지하는 재화 및 용역을 구매하는 경우\r\n\r\n3. 기타 구매신청에 승낙하는 것이 \\\"모노리스\\\"의 기술상 현저히 지장이 있다고 판단하는 경우\r\n\r\n② \\\"모노리스\\\"의 승낙이 제12조 제1항의 수신확인통지형태로 이용자에게 도달한 시점에 계약이 성립한 것으로 봅니다.\r\n\r\n③ \\\"모노리스\\\"의 승낙의 의사표시에는 이용자의 구매 신청에 대한 확인 및 판매가능 여부, 구매신청의 정정 취소 등에 관한 정보 등을 포함하여야 합니다.\r\n\r\n제11조(지급방법)\r\n\r\n\\\"모노리스\\\"에서 구매한 재화 또는 용역에 대한 대금지급방법은 다음 각호의 방법 중 가용한 방법으로 할 수 있습니다. 단, \\\"모노리스\\\"는 이용자의 지급방법에 대하여 재화 등의 대금에 어떠한 명목의 수수료도 추가하여 징수할 수 없습니다.\r\n\r\n1. 선불카드, 직불카드, 신용카드 등의 각종 카드 결제\r\n\r\n2. 온라인 무통장입금 및 카카오뱅크 결재\r\n\r\n3. 대금지급\r\n\r\n4. 그 외 \\\"모노리스\\\"가 향후 추가하는 기타 전자적 지급 방법에 의한 대금 지급 등\r\n\r\n제12조(수신확인통지·구매신청 변경 및 취소)\r\n\r\n① \\\"모노리스\\\"는 이용자의 구매신청이 있는 경우 이용자에게 수신확인통지를 합니다.\r\n\r\n② 수신확인통지를 받은 이용자는 의사표시의 불일치 등이 있는 경우에는 수신확인통지를 받은 후 즉시 구매신청 변경 및 취소를 요청할 수 있고 \\\"모노리스\\\"는 배송 전에 이용자의 요청이 있는 경우에는 지체 없이 그 요청에 따라 처리하여야 합니다. 다만 이미 대금을 지불한 경우에는 제15조의 청약철회 등에 관한 규정에 따릅니다.\r\n\r\n제13조(재화 등의 공급)\r\n\r\n① \\\"모노리스\\\"는 이용자와 재화 등의 공급시기에 관하여 별도의 약정이 없는 이상, 이용자가 청약을 한 날부터 7일 이내에 재화 등을 배송할 수 있도록 주문제작, 포장 등 기타의 필요한 조치를 취합니다. 다만, \\\"모노리스\\\"가 이미 재화 등의 대금의 전부 또는 일부를 받은 경우에는 대금의 전부 또는 일부를 받은 날부터 2영업일 이내에 조치를 취합니다. 이때 \\\"모노리스\\\"는 이용자가 재화 등의 공급 절차 및 진행 사항을 확인할 수 있도록 적절한 조치를 합니다.\r\n\r\n② \\\"모노리스\\\"는 이용자가 구매한 재화에 대해 배송수단, 수단별 배송비용 부담자, 수단별 배송기간 등을 명시합니다. 만약 \\\"모노리스\\\"가 약정 배송기간을 초과한 경우에는 그로 인한 이용자의 손해를 배상하여야 합니다. 다만 \\\"모노리스\\\"가 고의·과실이 없음을 입증한 경우에는 그러하지 아니합니다.\r\n\r\n제14조(환급)\r\n\r\n\\\"모노리스\\\"는 이용자가 구매 신청한 재화 등이 품절 등의 사유로 인도 또는 제공을 할 수 없을 때에는 지체 없이 그 사유를 이용자에게 통지하고 사전에 재화 등의 대금을 받은 경우에는 대금을 받은 날부터 2영업일 이내에 환급하거나 환급에 필요한 조치를 취합니다. 단, 유로카닷넷의 입찰정보는 일시 서비스 중단 (시스템 관리자의 고의, 과실이 없는 디스크 장애, 시스템 다운 등) 등의 사유로 환급하지 않습니다.\r\n\r\n제15조(청약철회 등)\r\n\r\n① \\\"모노리스\\\"와 재화 등의 구매에 관한 계약을 체결한 이용자는 수신확인의 통지를 받은 날부터 7일 이내에는 청약의 철회를 할 수 있습니다.\r\n\r\n② 이용자는 재화 등을 배송 받은 경우 다음 각호의 1에 해당하는 경우에는 반품 및 교환을 할 수 없습니다. 1. 이용자에게 책임 있는 사유로 재화 등이 멸실 또는 훼손된 경우(다만, 재화 등의 내용을 확인하기 위하여 포장 등을 훼손한 경우에는 청약철회를 할 수 있습니다) 2. 이용자의 사용 또는 일부 소비에 의하여 재화 등의 가치가 현저히 감소한 경우 3. 시간의 경과에 의하여 재판매가 곤란할 정도로 재화 등의 가치가 현저히 감소한 경우 4. 같은 성능을 지닌 재화 등으로 복제가 가능한 경우 그 원본인 재화 등의 포장을 훼손한 경우\r\n\r\n③ 제2항 제2호 내지 제4호의 경우에 \\\"모노리스\\\"가 사전에 청약철회 등이 제한되는 사실을 소비자가 쉽게 알 수 있는 곳에 명기하거나 시용상품을 제공하는 등의 조치를 하지 않았다면 이용자의 청약철회 등이 제한되지 않습니다.\r\n\r\n④ 이용자는 제1항 및 제2항의 규정에 불구하고 재화 등의 내용이 표시 광고 내용과 다르거나 계약내용과 다르게 이행된 때에는 당해 재화 등을 공급받은 날부터 3개월 이내, 그 사실을 안 날 또는 알 수 있었던 날부터 30일 이내에 청약철회 등을 할 수 있습니다.\r\n\r\n제16조(청약철회 등의 효과)\r\n\r\n① \\\"모노리스\\\"는 이용자로부터 재화 등을 반환 받은 경우 3영업일 이내에 이미 지급받은 재화 등의 대금을 환급합니다. 이 경우 \\\"모노리스\\\"가 이용자에게 재화 등의 환급을 지연한 때에는 그 지연기간에 대하여 공정거래위원회가 정하여 고시하는 지연이자율을 곱하여 산정한 지연이자를 지급합니다.\r\n\r\n② \\\"모노리스\\\"는 위 대금을 환급함에 있어서 이용자가 신용카드 또는 전자화폐 등의 결제수단으로 재화 등의 대금을 지급한 때에는 지체 없이 당해 결제수단을 제공한 사업자로 하여금 재화 등의 대금의 청구를 정지 또는 취소하도록 요청합니다.\r\n\r\n③ 청약철회 등의 경우 공급받은 재화 등의 반환에 필요한 비용은 이용자가 부담합니다. \\\"모노리스\\\"는 이용자에게 청약철회 등을 이유로 위약금 또는 손해배상을 청구하지 않습니다. 다만 재화 등의 내용이 표시 광고 내용과 다르거나 계약내용과 다르게 이행되어 청약철회 등을 하는 경우 재화 등의 반환에 필요한 비용은 \\\"모노리스\\\"가 부담합니다.\r\n\r\n④ 이용자가 재화 등을 제공받을 때 발송비를 부담한 경우에 \\\"모노리스\\\"는 청약철회 시 그 비용을 누가 부담하는지를 이용자가 알기 쉽도록 명확하게 표시합니다.\r\n\r\n제17조(개인정보보호)\r\n\r\n① \\\"모노리스\\\"는 이용자의 정보수집 시 구매계약 이행에 필요한 최소한의 정보를 수집합니다. 다음 사항을 필수사항으로 하며 그 외 사항은 선택사항으로 합니다.\r\n\r\n1. 성명과 닉네임\r\n\r\n2. 전자우편주소(또는 이동전화번호)\r\n\r\n3. 희망ID(회원의 경우)\r\n\r\n4. 비밀번호(회원의 경우)\r\n\r\n5. Mail / SMS 수신여부\r\n\r\n② \\\"모노리스\\\"가 이용자의 개인식별이 가능한 개인정보를 수집하는 때에는 반드시 당해 이용자의 동의를 받습니다.\r\n\r\n③ 제공된 개인정보는 당해 이용자의 동의 없이 목적 외의 이용이나 제3자에게 제공할 수 없으며, 이에 대한 모든 책임은 \\\"모노리스\\\"가 집니다. 다만, 다음의 경우에는 예외로 합니다.\r\n\r\n1. 배송업무상 배송업체에게 배송에 필요한 최소한의 이용자의 정보(성명, 주소, 전화번호)를 알려주는 경우\r\n\r\n2. 통계작성, 학술연구 또는 시장조사를 위하여 필요한 경우로서 특정 개인을 식별할 수 없는 형태로 제공하는 경우\r\n\r\n3. 재화 등의 거래에 따른 대금정산을 위하여 필요한 경우\r\n\r\n4. 도용방지를 위하여 본인확인에 필요한 경우\r\n\r\n5. 법률의 규정 또는 법률에 의하여 필요한 불가피한 사유가 있는 경우\r\n\r\n6. 추가된 제휴 서비스를 이용할 경우\r\n\r\n④ \\\"모노리스\\\"가 제2항과 제3항에 의해 이용자의 동의를 받아야 하는 경우에는 개인정보관리 책임자의 신원(소속, 성명 및 전화번호, 기타 연락처), 정보의 수집목적 및 이용목적, 제3자에 대한 정보제공 관련사항(제공받은 자, 제공목적 및 제공할 정보의 내용) 등 정보통신망 이용촉진 등에 관한 법률 제22조 제2항이 규정한 사항을 미리 명시하거나 고지해야 하며 이용자는 언제든지 이 동의를 철회할 수 있습니다.\r\n\r\n⑤ 이용자는 언제든지 \\\"모노리스\\\"가 가지고 있는 자신의 개인정보에 대해 열람 및 오류정정을 요구할 수 있으며 \\\"모노리스\\\"는 이에 대해 지체 없이 필요한 조치를 취할 의무를 집니다. 이용자가 오류의 정정을 요구한 경우에는 \\\"모노리스\\\"는 그 오류를 정정할 때까지 당해 개인정보를 이용하지 않습니다.\r\n\r\n⑥ \\\"모노리스\\\"는 개인정보 보호를 위하여 관리자를 한정하여 그 수를 최소화하며 신용카드, 은행계좌 등을 포함한 이용자의 개인정보의 분실, 도난, 유출, 변조 등으로 인한 이용자의 손해에 대하여 모든 책임을 집니다. ⑦ \\\"모노리스\\\" 또는 그로부터 개인정보를 제공받은 제3자는 개인정보의 수집목적 또는 제공받은 목적을 달성한 때에는 당해 개인정보를 지체 없이 파기합니다.\r\n\r\n제18조(\\\"모노리스\\\"의 의무)\r\n\r\n① \\\"모노리스\\\"는 법령과 이 약관이 금지하거나 공서양속에 반하는 행위를 하지 않으며 이 약관이 정하는 바에 따라 지속적이고, 안정적으로 재화·용역을 제공하는데 최선을 다하여야 합니다.\r\n\r\n② \\\"모노리스\\\"는 이용자가 안전하게 인터넷 서비스를 이용할 수 있도록 이용자의 개인정보(신용정보 포함)보호를 위한 보안 시스템을 갖추어야 합니다.\r\n\r\n③ \\\"모노리스\\\"가 상품이나 용역에 대하여 「표시·광고의 공정화에 관한 법률」 제3조 소정의 부당한 표시·광고행위를 함으로써 이용자가 손해를 입은 때에는 이를 배상할 책임을 집니다.\r\n\r\n④ \\\"모노리스\\\"는 이용자가 원하지 않는 영리목적의 광고성 전자우편을 발송하지 않습니다.\r\n\r\n제19조(회원의 ID 및 비밀번호에 대한 의무)\r\n\r\n① 제17조의 경우를 제외한 ID와 비밀번호에 관한 관리책임은 회원에게 있습니다.\r\n\r\n② 회원은 자신의 ID 및 비밀번호를 제3자에게 이용하게 해서는 안됩니다.\r\n\r\n③ 회원이 자신의 ID 및 비밀번호를 도난 당하거나 제3자가 사용하고 있음을 인지한 경우에는 바로 \\\"모노리스\\\"에 통보하고 \\\"한메\\\"의 안내가 있는 경우에는 그에 따라야 합니다.\r\n\r\n제20조(이용자의 의무) 이용자는 다음 행위를 하여서는 안됩니다.\r\n\r\n1. 신청 또는 변경 시 허위 내용의 등록\r\n\r\n2. 타인의 정보 도용\r\n\r\n3. \\\"모노리스\\\"에 게시된 정보의 변경\r\n\r\n4. \\\"모노리스\\\"가 정한 정보 이외의 정보(컴퓨터 프로그램 등) 등의 송신 또는 게시\r\n\r\n5. \\\"모노리스\\\"에 기타 제3자의 저작권 등 지적재산권에 대한 침해\r\n\r\n6. \\\"모노리스\\\"에 기타 제3자의 명예를 손상시키거나 업무를 방해하는 행위\r\n\r\n7. 외설 또는 폭력적인 메시지, 화상, 음성, 기타 공서양속에 반하는 정보를 \\\"모노리스\\\"에 공개 또는 게시하는 행위\r\n\r\n제21조(연결 \\\"서비스\\\"와 피연결 \\\"서비스\\\" 간의 관계)\r\n\r\n① 상위 \\\"서비스\\\"와 하위 \\\"서비스\\\"가 하이퍼링크(예: 하이퍼링크의 대상에는 문자, 그림 및 동화상 등이 포함됨)방식 등으로 연결된 경우, 전자를 연결 \\\"서비스\\\"(웹 사이트)라고 하고 후자를 피연결 \\\"서비스\\\"(웹사이트)라고 합니다.\r\n\r\n②연결 \\\"서비스\\\"는 피연결 \\\"서비스\\\"가 독자적으로 제공하는 재화 등에 의하여 이용자와 행하는 거래에 대해서 보증책임을 지지 않는다는 뜻을 연결 \\\"서비스\\\"의 초기화면 또는 연결되는 시점의 팝업화면으로 명시한 경우에는 그 거래에 대한 보증책임을 지지 않습니다.\r\n\r\n제22조(저작권의 귀속 및 이용제한)\r\n\r\n① \\\"모노리스\\\"에 게시한 글의 저작권에 대한 일체의 권리는 해당 글의 게시자에게 있습니다.\r\n\r\n② 타인의 모든 컨텐츠(글, 그림, 사진, 이미지, 기타 어떤 형태로든)를 출처표기 없이 무단으로 전재해서 본 사이트에 옮겨 실었을 때 생기는 모든 법적인 문제에 대한 책임은 해당 글을 게시한 회원이 집니다.\r\n\r\n③ 타 상업 사이트의 모든 컨텐츠(글, 그림, 사진, 이미지, 기타 어떤 형태로든)를 본 사이트에 게시한 경우에, 이 게시물은 출처표기의 유무를 떠나 삭제조치 되며, 이에 대한 모든 법적인 문제는 해당 글을 게시한 회원이 집니다.\r\n\r\n④ \\\"모노리스\\\"의 컨텐츠(글, 그림, 사진, 이미지, 기타 어떤 형태로든)를 출처표기 없이 무단으로 전재해서 타 사이트에 옮겨 실었을 때, 본 사이트의 관리 운영자는 원 저작권자를 대신해 해당 사이트에 삭제 요청을 할 수 있는 권한을 가집니다.\r\n\r\n⑤ “모노리스”이 자체적으로 생산하거나, 회원들이 생산한 모든 컨텐츠는 “모노리스” 측에서 적법한 절차를 거쳐 타 업체에 유료 혹은 무료로 제공할 수 있습니다.\r\n\r\n제23조(분쟁해결)\r\n\r\n① \\\"모노리스\\\"는 이용자가 제기하는 정당한 의견이나 불만을 반영하고 그 피해를 보상처리하기 위하여 피해보상처리기구를 설치·운영합니다.\r\n\r\n② \\\"모노리스\\\"는 이용자로부터 제출되는 불만사항 및 의견은 우선적으로 그 사항을 처리합니다. 다만, 신속한 처리가 곤란한 경우에는 이용자에게 그 사유와 처리일정을 즉시 통보해 드립니다.\r\n\r\n③ \\\"모노리스\\\"와 이용자간에 발생한 전자상거래 분쟁과 관련하여 이용자의 피해구제신청이 있는 경우에는 공정거래위원회 또는 시 도지사가 의뢰하는 분쟁조정기관의 조정에 따를 수 있습니다.\r\n\r\n제24조(재판권 및 준거법)\r\n\r\n① \\\"모노리스\\\"와 이용자간에 발생한 전자상거래 분쟁에 관한 소송은 제소 당시의 이용자의 주소에 의하고, 주소가 없는 경우에는 거소를 관할하는 지방법원의 전속관할로 합니다. 다만, 제소 당시 이용자의 주소 또는 거소가 분명하지 않거나 외국 거주자의 경우에는 민사소송법상의 관할법원에 제기합니다.\r\n\r\n② \\\"모노리스\\\"와 이용자간에 제기된 전자상거래 소송에는 한국법을 적용합니다. 부칙 본 약관은 2018년 12월 24일 처음 제정하여 2018년 12월 25일 개정을 거쳐 2019년 1월 1일 재개정하여 2019년 1월 1일부터 시행한다.\r\n\r\n2018년 12월 24일 제정\r\n\r\n2018년 12월 25일 개정\r\n\r\n2019년 1월 7일 개정\r\n\r\n모노리스 (www.uloca.net)', 'no'),
