(35474, 'cosmosfarm_members_policy_privacy', '\\\"유로카닷넷\\\"에서의 개인정보 취급 방침은 고객이 정보를 위하여 모노리스에서 실시하는 개인 정보 수집의 목적과 그 정보의 정책적,시스템적 보안에 관한 규정입니다. 기본적인 사생활 비밀과 자유 및 통신 비밀을 보장 불접적인 도청, 정보 유출로 인한 인권 피해가 발생하지 않도록 하고자 마련한 것입니다.\r\n<h6># 모노리스 개인정보 수집 및 이용에 대한 안내 #######</h6>\r\n■ 개인정보의 수집 및 이용목적 회사는 수집한 개인정보를 다음의 목적을 위해 활용합니다.\r\n\r\n1. 서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산 콘텐츠 제공, 구매 및 요금 결제, 물품배송 또는 청구지 등 발송, 금융거래 본인 인증 및 금융 서비스\r\n\r\n2. 회원 관리 회원제 서비스 이용에 따른 본인확인, 개인 식별, 불량회원의 부정 이용 방지와 비인가 사용 방지, 가입 의사 확인, 연령확인 불만처리 등 민원처리, 고지사항 전달\r\n\r\n3. 마케팅 및 광고에 활용 이벤트 등 광고성 정보 전달, 인구통계학적 특성에 따른 서비스 제공 및 광고 게재, 접속 빈도 파악 또는 회원의 서비스 이용에 대한 통계\r\n\r\n■ 수집하는 개인정보 항목 회사는 회원가입, 상담, 서비스 신청 등등을 위해 아래와 같은 개인정보를 수집하고 있습니다.\r\n\r\n1 수집항목\r\n\r\nο 필수항목 : 이름, 로그인ID, 비밀번호, 서비스 이용기록, 접속 로그, 쿠키, 접속 IP 정보\r\n\r\nο 선택항목 : 성별, 생년월일, 자택 전화번호, 자택 주소, 휴대전화번호, 직장명, 직장 전화번호, 직장 주소 등\r\n\r\nο 구매시 항목 : 주민등록번호, 신용카드 정보, 은행계좌 정보, 결제기록, 사업자등록증 등\r\n\r\n2 개인정보 수집방법 : 모노리스 홈페이지(www.uloca.net) 가입을 통해서\r\n\r\n■ 개인정보의 보유 및 이용기간 회사는 개인정보 수집 및 이용목적이 달성된 후에는 예외 없이 해당 정보를 지체 없이 파기합니다.\r\n\r\n■ 개인정보의 파기절차 및 방법 회사는 원칙적으로 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체없이 파기합니다. 파기절차 및 방법은 다음과 같습니다.\r\n\r\n1 파기절차 : 회원님이 회원가입 등을 위해 입력하신 정보는 목적이 달성된 후 별도의 DB로 옮겨져(종이의 경우 별도의 서류함) 내부 방침 및 기타 관련 법령에 의한 정보보호 사유에 따라(보유 및 이용기간 참조) 일정 기간 저장된 후 파기되어집니다. 별도 DB로 옮겨진 개인정보는 법률에 의한 경우가 아니고서는 보유되어지는 이외의 다른 목적으로 이용되지 않습니다.\r\n\r\n2 파기방법 : 전자적 파일형태로 저장된 개인정보는 기록을 재생할 수 없는 기술적 방법을 사용하여 삭제합니다.', 'no'),
